// };

export const signUp = async (req, res) => {
  try {
    const { name, email, password, contact } = req.body;

    // Check if the user already exists
    const getUserData = await userModel.findOne({ email: email });

    if (getUserData) {
      // User already exists
      return res.status(409).json({
        message: "User already exists",
      });
    }

    // Hash the password
    const newPassword = bcrypt.hashSync(password, 10);

    // Create a new user
    const userData = new userModel({
      name: name,
      email: email,
      password: newPassword,  
      contact: contact,
    });

    // Save the user to the database
    const savedUserData = await userData.save();

    if (savedUserData) {
      // User registered successfully
      return res.status(200).json({
        data: savedUserData,
        message: "Successfully signed up!",
      });
    } else {
      // Some error occurred during registration
      return res.status(500).json({
        message: "Failed to register user",
      });
    }
  } catch (error) {
    // Handle other unexpected errors
    console.error("Error:", error);
    res.status(500).json({
      message: "Internal server error",
    });
  }
};

export const signIn = async (req, res) => {
  try {
    const { email, password } = req.body;
    // console.log("Received a sign-in request with credentials:", email);
    const userData = await userModel.findOne({ email: email });
    if (!userData) {
      return res.status(400).json({
        message: "User doesn't exist!",
      });
    }
    const comparePassword = bcrypt.compareSync(password, userData.password);
    if (!comparePassword) {
      return res.status(400).json({
        message: "Invalid credential",
      });
    }
    const token = jwt.sign(
      { userid: userData._id, email: userData.email },
      process.env.SECRET_KEY,
      { expiresIn: "1h" }
    );
    res.cookie("userdata", userData);
    return res.status(200).json({
      token: token,
      data: userData,
      message: "Successfully login",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};

