import multer from "multer";
import path from "path";
import fs from "fs";
import eventModel from "../Model/event.model";

const storage = multer.diskStorage({
  destination: function (req, file, cb) {
    if (fs.existsSync("./uploads")) {
      cb(null, "./uploads");
    } else {
      fs.mkdirSync("./uploads", true);
      cb(null, "./uploads");
    }
  },

  filename: function (req, file, cb) {
    const imgname = file.originalname;
    const imgarr = imgname.split(".");
    imgarr.pop();
    const imgExt = path.extname(imgname);
    const fname = imgarr.join(".") + "-" + Date.now() + imgExt;
    cb(null, fname);
  },
});

const upload = multer({ storage: storage });

export const getEvents = async (req, res) => {
  try {
    const categoryId = req.query.q;
    // console.log(categoryId);
    const eventData = await eventModel.find({
      status: 1,
      // categoryId: categoryId,
    });
    res.status(200).json({
      data: eventData,
      message: "Successfully event data fetched !",
      path: "http://localhost:8282:/uploads",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};

export const getEventsById = async (req, res) => {
  try {
    const categoryId = req.params.categoryId;
    const eventData = await eventModel.find({
      status: 1,
      categoryId: categoryId,
    });
    res.status(200).json({
      data: eventData,
      message: "Successfully event data fetched !",
      path: "http://localhost:8282:/uploads",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};


export const getEventsByEventId = async (req, res) => {
  try {
    const eventID = req.params._id;
    const eventData = await eventModel.find({
      status: 1,
      _id: eventID,
    });
    res.status(200).json({
      data: eventData,
      message: "Successfully event data fetched !",
      path: "http://localhost:8282:/uploads",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};




export const getEventData = async (req, res) => {
  try {
    const categoryId = req.params.categoryId;
    // const categoryId = req.query.categoryId;
    const eventData = await eventModel.find({ status: 1 });
    res.status(200).json({
      data: eventData,
      message: "Successfully event data fetched !",
      path: "http://localhost:8282:/uploads",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};

export const getEventsTag = async (req, res) => {
  try {
    const eventNames = await eventModel
      .find({ status: 1 })
      .distinct("eventTag");
    res.status(200).json({
      data: eventNames,
      message: "successfully data fateched by query id",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};

export const getEventsByQuery = async (req, res) => {
  try {
    const categoryId = req.query.eventTag;
    // console.log(categoryId);
    const eventData = await eventModel.find({
      status: 1,
      eventTag: categoryId,
    });
    res.status(200).json({
      data: eventData,
      message: "successfully data fateched by query id",
    });
  } catch (error) {
    res.status(500).json({
      message: error.message,
    });
  }
};

// export const getEventData = async (req, res) => {
//   try {
//     const categoryId = req.params.categoryId;
